import React from 'react';

const About = () => {
    return (
        <div className="about">
            <h1>About 130 1/2 INTERSTATE</h1>
            <p>
                Welcome to 130 1/2 INTERSTATE! We are dedicated to providing exceptional services to our customers.
                Our mission is to deliver quality and value in everything we do. 
            </p>
            <h2>Our History</h2>
            <p>
                Founded in [Year], 130 1/2 INTERSTATE has grown from a small business into a trusted name in the industry.
                Our commitment to excellence has driven our success and we continue to strive for improvement.
            </p>
            <h2>Our Values</h2>
            <ul>
                <li>Integrity: We believe in doing the right thing.</li>
                <li>Customer Focus: Our customers are at the heart of everything we do.</li>
                <li>Innovation: We embrace change and seek new ways to improve.</li>
            </ul>
        </div>
    );
};

export default About;
